import React from "react";
import Grid from "../elements/Grid";

import styled from "styled-components";

const Post = (props) => {
  return (
    <React.Fragment>
      <As padding="16px">
        <div>user profile / user name / insert_dt / is_me btn </div>
        <div>contents</div>
        <div>image</div>
        <div>comment cnt</div>
      </As>
    </React.Fragment>
  );
};

// props로 데이터를 받아올때 부모가 정보를 주지 못할경우가 생기게 된다면?
