Post.defaultProps = {
  user_info: {
    user_name: "suin",
    user_profile:
      "../images/user_profile_01.jpehttp://t1.daumcdn.net/friends/prod/editor/dc8b3d02-a15a-4afa-a88b-989cf2a50476.jpg",
  },
  image_url:
    "http://t1.daumcdn.net/friends/prod/editor/dc8b3d02-a15a-4afa-a88b-989cf2a50476.jpg",
  contents: "저의 이모티콘입니다!",
  comment_cnt: 10,
  insert_dt: "2021-11-29 10:00:00",
};

const As = styled.Grid`
  background-color: antiquewhite;
`;

export default Post;
